import React from "react";
// import "./FaceRecongition.css";

const FaceRecongition = () => {
  return (
    <div className="center">
      <img
        alt=""
        src="https://images.pexels.com/photos/1595387/pexels-photo-1595387.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260 "
        width="1000px"
        height="800px"
      ></img>
    </div>
  );
};

export default FaceRecongition;
